func Test_processDpkgStatus(t *testing.T) {
	type args struct {
		h io.Reader
	}
	tests := []struct {
		name         string
		args         args
		wantPackages []softwarePackage
	}{
		// TODO: Add test cases.
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			if gotPackages := processDpkgStatus(tt.args.h); !reflect.DeepEqual(gotPackages, tt.wantPackages) {
				t.Errorf("processDpkgStatus() = %v, want %v", gotPackages, tt.wantPackages)
			}
		})
	}
}

